        private static readonly ConcurrentDictionary<string, FileValue> _values =
            new ConcurrentDictionary<string, FileValue>(_knownValues);

        private FileValue(string value)
        {
            if (value == null) throw new ArgumentNullException(nameof(value));
            Value = value;
        }

        public string Value { get; }

        public static FileValue Of(string value)
        {
            return _values.GetOrAdd(value, _ => new FileValue(value));
        }

        public static implicit operator FileValue(string value) => Of(value);
        public static implicit operator string(FileValue filevalue) => filevalue.Value;

        public static FileValue[] Values()
        {
            return _values.Values.ToArray();
        }

        public override string ToString() => Value.ToString();

        public bool IsKnown()
        {
            return _knownValues.ContainsKey(Value);
        }

        public override bool Equals(object? obj) => Equals(obj as FileValue);

        public bool Equals(FileValue? other)
        {
            if (ReferenceEquals(this, other)) return true;
            if (other is null) return false;
            return string.Equals(Value, other.Value);
        }

        public override int GetHashCode() => Value.GetHashCode();
    }

